import React from "react";
import Header from "../../Components/Header/Header";
import Hero from "../../Components/Hero/Hero";
function Home() {
  return (
    <div className="Homepage">
      <>
        <Header />
      </>
      <>
        <Hero />
      </>
    </div>
  );
}

export default Home;
